import React ,{ Component } from "react";
import Link from "next/link";
import fetch from 'isomorphic-fetch';
import Layout from "../Components/Layout";
import { Table, Col, Row } from 'react-bootstrap';


class Home extends Component{
    
    constructor(props)
    {
        super(props);
        this.state = {
            data: [],
            isLoaded:false,
        }
    }
    componentDidMount()
    {
        fetch('http://localhost:50607/api/item').then(res => res.json()).then(json => {
        this.setState({
            isLoaded:true,
            data:json,  
        })
    });
    }
    render()
    {
       var { isLoaded, data } = this.state;
        if(!isLoaded)
        {
            return <div>Loading....</div>;
        }
        {data.map(item => {
            return (
             <td>
              <ul>{item.id}</ul>
             </td>
             );
       })}
        return(

           <Layout>
                  <div>
                <h1>Gudid Data</h1>               
                <div>
                    
                </div>
                <Row>
                    <Col mdoffset={10} md={2}>
                        {/* <Link to='/createOwner' >Create Owner</Link> */}
                        <Link href ='/createOwner'><a className='nav-link'>createOwner</a>
                        </Link>
                    </Col>
                </Row>
                <br />
                <Row>
                    <Col md={12}>
                        <Table responsive striped>
                            <thead>
                                <tr>
                                    <th>CompanyName</th>
                                    <th>Device Description</th>
                                    <th>GMDN Name</th>
                                    <th>BrandName</th>
                                    <th>DunsNumber</th>
                                    
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <td>
                                    {data[0].id}
                                    </td>
                                    {/* <td>
                                    {data.gudid.device.deviceDescription}
                                    </td>
                                    <td>
                                    {data.gudid.device.gmdnTerms.gmdn[0].gmdnPTName}
                                    </td>
                                    <td>
                                    {data.gudid.device.brandName}
                                    </td>
                                    <td>
                                    {data.gudid.device.dunsNumber}
                                    </td> */}
                                </tr>
                            </tbody>
                        </Table>
                    </Col>
                </Row>
                </div>
            </Layout>



        );
    }
}

export default Home;
